def matches_token(token: str, pc: int):

    if not token:
        raise ValueError("need a token")

    or_more = token[-1] == "+"
    or_less = token[-1] == "-"

    val_token = int(token[:-1]) if or_more or or_less else int(token)

    if or_more:
        return pc >= val_token
    elif or_less:
        return pc <= val_token
    else:
        return pc == val_token

