def format_seconds(seconds):


    # ensure to show negative time frames correctly
    hour_factor = 1
    if seconds < 0 :
        hour_factor = -1
        seconds = - seconds

    hours = seconds // 3600
    minutes = seconds % 3600 // 60
    seconds = seconds % 60
